import { Component } from '@angular/core';
import { NavController, ModalController } from 'ionic-angular';
import { CameraPreviewPictureOptions, CameraPreview } from '@ionic-native/camera-preview';
import { PicModalPage } from '../pic-modal/pic-modal';
import { ClarifaiService } from '../../services/clarifai.service';

import * as Clarifai from 'clarifai';
 
@Component({
  selector: 'page-home',
  templateUrl: 'home.html'
})
export class HomePage {
  app = new Clarifai.App({
    apiKey: 'd1f89510500542898b0f12b699852ba1'
  });

  intervally: any;

  err: string = "buttface";
  success: number = 1738;
  results: any;

  //picture options
  pictureOpts: CameraPreviewPictureOptions = {
    width: 1280,
    height: 1280,
    quality: 85
  }
  picture: string;

  constructor(public navCtrl: NavController,
              private cameraPreview: CameraPreview,
              private modalCtrl: ModalController,
              private clarifaiService: ClarifaiService) {}

  allTogetherNow(){
    this.clarifaiService.setupInputs();
    this.clarifaiService.createMachine();
    this.clarifaiService.trainMachine();
  }

  letsSeeIt(){
    console.log(this.results.value);
    console.log(this.results.name);

  }

  predict = (base64: string) => {
      let imageData = base64.replace(/^data:image\/(.*);base64,/, '');
      this.app.models.predict("test", [imageData]).then(
  
          (response) => {
                  console.log(response);
                  console.log(response.outputs[0].data.concepts[0]);
                  this.results = response.outputs[0].data.concepts[0].value;
          },
          (err) => {
                  console.log(err);
                  this.err = err.data.status.details
          }
      )
    }

  takePicture(){

    // take a picture
    this.cameraPreview.takePicture(this.pictureOpts).then((imageData) => {
      this.picture = 'data:image/jpeg;base64,' + imageData;
    }, (err) => {
      console.log(err);
    });
    this.predict(this.picture);
  }

  openModal(){
    let modal = this.modalCtrl.create(PicModalPage, { base64Image: this.picture });
    modal.present();
  }
  
  refresh(){
    window['location'].reload();
  }
  
  reload(){
    console.log(this.success)
  }

  base64Image = "data:image/jpeg;base64,"
}

